import React from 'react';
import { Switch, Route, Link, Router } from 'react-router-dom';
import Login from './components/Login';
import GetList2 from './components/GetList2';
import './Loginn.css';


export default class App extends Component {
    render() {
        return (

            <div>
               
                <Login />
                <GetList2 />
            </div>
        )
    }
};
